import {legacy_createStore as createStore} from 'redux';

const initialState = {
    patientDataObj: "Rafsan",
}

const reducer = (state=initialState, action) => {

    switch(action.type) {

        case "SETPATIENTDATA":
            return{
                ...state, 
                patientDataObj:action.payload
            }

        default:
            return state
    }
}

export default createStore(reducer);
